@Dryad I would turn `a` `b` `c` into an array of strings first:
```c
string options[3];
option[0] = get_string("Option 1: ");
option[1] = get_string("Option 2: ");
option[2] = get_string("Option 3: ");
```

from there, a simple call to rand would suffice (include stdlib.h first):
```c
printf("The randomizer has selected: %s\n", options[rand() % 3]);
```

if you aren't comfortable with arrays, perhaps a switch statement would do as well:
```c
{
    string a = get_string("Option 1: ");
    string b = get_string("Option 2: ");
    string c = get_string("Option 3: ");
    string selection;
    switch (rand() % 3)
    {
        case 0:
            selection = a;
        case 1:
            selection = b;
        case 2:
            selection = c;
    }
    printf("The randomizer has selected: %s\n", selection);
}
```

