Well the problem was that the function I was using this for took a `char *` as its input. I went ahead and used `strcpy` to copy pointer to array:
```C
#include <stdio.h>
#include <ctype.h>
#include <string.h>

int main(void)
{
    char *ptr = "HELLO WoRlD";
    int length = strlen(ptr);
    char str[length];
    strcpy(str, ptr);

    for(int i = 0; i < length; i++)
    {
      str[i] = tolower(str[i]);
    }
    printf("%s\n", str);
}
```

So the first string is mainly to simulate the value I will be getting from the function I will be using. I went ahead and fixed the code according to your suggestions and created a function to simulate it's use:
```C
#include <stdio.h>
#include <ctype.h>
#include <string.h>

void printstring(const char *word);

int main(void)
{
    const char *string = "HELLO WoRlD";
    printstring(string);
}

void printstring(const char *ptr)
{
    int length = strlen(ptr);
    char str[length + 1];

    for(int i = 0; i < length; i++)
    {
      str[i] = tolower(ptr[i]);
    }
    printf("%s\n", str);
}
```

