    {
        //If list is empty, point list at the new node
        //and set newNode's pointer to null
        if (list == NULL)
        {
            newNode->number = number;
            newNode->next = NULL;
            list = newNode;
        }
        //If list already has elements of type struct node
        else
        {
            //Create a new temporary pointer
            node *tmp = list;

