@UnknownShadow So, if you have
int \*arr
you can write arr[x] which means \*(arr + x)
In your example, you go with backward direction
int (\*arr)[size]
you can now write something like arr[x][y] -> \*(((int\*)arr + x\*size) + y). Because arr points to array of size elements.

About syntaxes. I could imaging only one case, when you should use it: when you know number of elements in row (columns) and don‚Äôt know number of rows (for example it comes to your function as an argument).

You should also pay attention that you may request a huge unbroken sequence of bytes from system. That may be impossible (even if you have enough free-memory in total, read about memory fragmentation - https://en.wikipedia.org/wiki/Memory_management).
To overcome this issue (at least partially) you can use 2 dimensional (pointer-to-pointer) approach
int \*\*arr;
arr = malloc(R \* sizeof(int \*));
for (int i = 0; i < R; ++i) {
    arr[i] = malloc(C \* sizeof(int));
}

By the way, do not forget, to use free()-function

